// src/components/Services.js
import React from 'react';

const servicesList = [
  { id: 1, title: "Personalized Meal Plans", description: "Custom plans tailored to your goals and needs" },
  { id: 2, title: "Diet Consultations", description: "One-on-one consultations with a certified nutritionist." },
  { id: 3, title: "Health Coaching", description: "Guidance to help you adopt a healthier lifestyle.",  },
];

const Services = () => {
  return (
    <div className="services">
      <h2>Our Services</h2>
      <div className="services-list">
        {servicesList.map((service) => (
          <div key={service.id} className="service-card">
            <h3>{service.title}</h3>
            <p>{service.description}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Services;
